import React from 'react'
import PropTypes from 'prop-types'

function RepoList({repos}) {
  return (
    <div className='rounded-lg shadow-lg card bg-base-100'>
      repos
    </div>
  )
}

RepoList.protoTypes={
    repos:PropTypes.array.isRequired,
}

export default RepoList
